import{_ as e,c as r,o as a,a as t}from"./app.d304f55e.js";const v=JSON.parse('{"title":"\u041F\u0440\u043E \u043C\u043E\u0439 \u0434\u0432\u043E\u0440","description":"","frontmatter":{"title":"\u041F\u0440\u043E \u043C\u043E\u0439 \u0434\u0432\u043E\u0440","tags":"writingArchive","date":"2009-09-09T00:00:00.000Z"},"headers":[],"relativePath":"art/writing/archive/yard.md"}'),n={name:"art/writing/archive/yard.md"},s=t("p",null,"\u041C\u043D\u0435 \u043A\u0430\u0436\u0435\u0442\u0441\u044F, \u043F\u043E\u0440\u0430 \u0440\u0430\u0441\u0441\u043A\u0430\u0437\u0430\u0442\u044C \u0443\u0436\u0435 \u043E\u0431\u043E \u0432\u0441\u0435\u043C, \u0447\u0442\u043E \u0442\u0432\u043E\u0440\u0438\u0442\u0441\u044F \u0443 \u043C\u0435\u043D\u044F \u0432\u043E \u0434\u0432\u043E\u0440\u0435. \u0414\u0432\u043E\u0440 \u0443 \u043C\u0435\u043D\u044F \u043D\u0435 \u043F\u0440\u043E\u0441\u0442\u043E\u0439, \u0430 \u0436\u0438\u0432\u043E\u0439. \u0416\u0438\u0432\u0435\u0442 \u043E\u043D \u0441\u0432\u043E\u0435\u0439, \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E \u043D\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043C\u043E\u0439 \u0436\u0438\u0437\u043D\u044C\u044E. \u0418 \u0447\u0430\u0441\u0442\u0435\u043D\u044C\u043A\u043E \u0443\u0434\u0438\u0432\u043B\u044F\u0435\u0442 \u043C\u0435\u043D\u044F.",-1),o=t("p",null,'\u041D\u0430\u0447\u043D\u0435\u043C \u0441 \u0442\u043E\u0433\u043E, \u0447\u0442\u043E \u044D\u0442\u043E\u0442 \u0434\u0432\u043E\u0440 \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0434\u043B\u044F \u043C\u0435\u043D\u044F \u0447\u0430\u0441\u0442\u044C\u044E \u0436\u0438\u0437\u043D\u0435\u043D\u043D\u043E\u0433\u043E \u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0441\u0442\u0432\u0430, \u043A\u0430\u043A \u0437\u0430\u0434\u043D\u0438\u0439 \u0434\u0432\u043E\u0440\u0438\u043A \u0432 \u0434\u0430\u0447\u0435. \u0422\u0443\u0442 \u043F\u043E\u0434 \u043E\u043A\u043D\u043E\u043C \u043A \u0434\u0435\u0440\u0435\u0432\u0443 \u043F\u0440\u0438\u0441\u0442\u0435\u0433\u043D\u0443\u0442 \u043C\u043E\u0439 \u0441\u043A\u0443\u0442\u0435\u0440 \u0421\u0430\u043B\u0430\u0442 \u0438 \u043F\u0430\u0440\u043A\u0443\u0435\u0442\u0441\u044F \u0421\u0442\u0430\u0440\u043C\u043E\u0431\u0438\u043B\u044C. \u0412 \u044D\u0442\u043E\u0442 \u0434\u0432\u043E\u0440 \u044F \u0432\u044B\u0441\u0442\u0430\u0432\u043B\u044F\u044E \u0432 \u043E\u043A\u043D\u043E \u0432\u0441\u044F\u043A\u0438\u0435 \u043F\u0430\u043A\u0435\u0442\u044B \u043F\u0440\u043E\u043A\u0438\u0441\u0448\u0435\u0433\u043E \u043C\u043E\u043B\u043E\u043A\u0430 \u0438 \u0433\u0440\u044F\u0437\u043D\u044B\u0435 \u0442\u0440\u044F\u043F\u043A\u0438 \u0438 \u043E\u043D\u0438 \u043C\u0430\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u043C \u043E\u0431\u0440\u0430\u0437\u043E\u043C \u0438\u0441\u0447\u0435\u0437\u0430\u044E\u0442. \u041D\u0430 \u0441\u043A\u0430\u043C\u0435\u0439\u043A\u0435 \u043F\u043E\u0434 \u043C\u043E\u0438\u043C \u043E\u043A\u043D\u043E\u043C \u0443\u0434\u0438\u0432\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u0433\u0430\u0440\u043C\u043E\u043D\u0438\u0447\u043D\u043E \u0438 \u043F\u043E\u0441\u043C\u0435\u043D\u043D\u043E \u043F\u0440\u043E\u0432\u043E\u0434\u044F\u0442 \u0441\u0432\u043E\u0439 \u0434\u043E\u0441\u0443\u0433 \u043C\u043E\u0438 \u0441\u043E\u0441\u0435\u0434\u0438 "\u0433\u043E\u043F\u043D\u0438\u0447\u043A\u0438" - \u041B\u0451\u0445\u0430 \u041F\u0430\u043D\u043A, \u0413\u043B\u0430\u0432\u0430\u0440\u044C, \u041B\u044B\u0441\u044B\u0439, \u0438 \u0442\u043E\u043B\u0441\u0442\u044B\u0439 \u0421\u0430\u043B\u0438\u043C. \u0418\u043C\u0435\u043D\u0430 \u044D\u0442\u0438 \u044F \u043A\u0430\u043A-\u0442\u043E \u043E\u0442 \u043D\u0438\u0445 \u0443\u0437\u043D\u0430\u043B, \u0430 \u043A\u043B\u0438\u0447\u043A\u0438 - \u044D\u0442\u043E \u044F \u0438\u043C \u043F\u0440\u0438\u0434\u0443\u043C\u0430\u043B, \u0447\u0442\u043E\u0431\u044B \u0445\u043E\u0442\u044C \u043A\u0430\u043A-\u0442\u043E \u0438\u0445 \u0440\u0430\u0437\u043B\u0438\u0447\u0430\u0442\u044C, \u0432 \u0441\u043C\u0435\u043D\u0443 \u0432 \u0441\u0443\u0431\u0431\u043E\u0442\u0443 \u0438 \u0432\u043E\u0441\u043A\u0440\u0435\u0441\u0435\u043D\u044C\u0435 \u0443\u0442\u0440\u043E\u043C \u0442\u0430\u043C \u0441\u0438\u0434\u044F\u0442 \u0431\u0430\u0431\u0443\u043B\u0438 \u0438 \u0441\u043F\u043B\u0435\u0442\u043D\u0438\u0447\u0430\u044E\u0442, \u0432\u043E \u0433\u043B\u0430\u0432\u0435 \u0443 \u043D\u0438\u0445 \u0433\u0440\u043E\u043C\u043E\u0433\u043B\u0430\u0441\u043D\u0430\u044F \u0438 \u0441\u0443\u0440\u043E\u0432\u0430\u044F, \u043D\u043E \u043A\u043E \u043C\u043D\u0435 \u0434\u043E\u0431\u0440\u0430\u044F \u0431\u0430\u0431\u0443\u043B\u044F. \u0413\u043E\u043B\u043E\u0441 \u0443 \u043D\u0435\u0435 \u043F\u043E\u0447\u0442\u0438 \u043C\u0443\u0436\u0441\u043A\u043E\u0439, \u0433\u0440\u043E\u043C\u043A\u0438\u0439 \u0438 \u0440\u0443\u0433\u0430\u0435\u0442\u0441\u044F \u043E\u043D\u0430 \u043F\u043E\u0441\u0442\u043E\u044F\u043D\u043D\u043E. \u0422\u043E\u043B\u044C\u043A\u043E \u043C\u0435\u043D\u044F \u0445\u0432\u0430\u043B\u0438\u0442 \u0437\u0430 \u0442\u043E, \u0447\u0442\u043E \u044F \u043C\u043E\u043F\u0435\u0434 \u0447\u0435\u0445\u043B\u043E\u043C \u043D\u0430\u043A\u0440\u044B\u0432\u0430\u044E, \u0438 \u043D\u0430 \u0440\u0430\u0431\u043E\u0442\u0443 \u043F\u043E \u0443\u0442\u0440\u0430\u043C \u0435\u0437\u0436\u0443 \u0432\u0441\u0435\u0433\u0434\u0430 =) \u0412 \u043F\u0435\u0440\u0435\u0440\u044B\u0432\u0430\u0445 \u043C\u0435\u0436\u0434\u0443 \u044D\u0442\u0438\u043C\u0438 \u0441\u043C\u0435\u043D\u0430\u043C\u0438 \u043D\u0430 \u0441\u043A\u0430\u043C\u0435\u0439\u043A\u0435 \u043F\u0440\u043E\u0432\u043E\u0434\u044F\u0442 \u0441\u0432\u043E\u0435 \u0432\u0440\u0435\u043C\u044F \u043F\u0430\u0440\u043E\u0447\u043A\u0438 \u0434\u0435\u0432\u0447\u043E\u043D\u043E\u043A \u0441 \u043F\u0438\u0432\u043A\u043E\u043C, \u043A\u0430\u043A\u0438\u0435-\u0442\u043E \u043A\u043B\u0435\u0440\u043A\u0438 \u0438\u0437 \u0431\u0438\u0437\u043D\u0435\u0441-\u0446\u0435\u043D\u0442\u0440\u0430 \u043D\u0435\u043F\u043E\u0434\u0430\u043B\u0435\u043A\u0443. \u0415\u0449\u0435 \u0435\u0441\u0442\u044C \u0434\u0432\u0430 \u0431\u043B\u0438\u0437\u043D\u0435\u0446\u0430, \u0432\u043E\u0442 \u0441\u0435\u0439\u0447\u0430\u0441 \u0437\u0430 \u043E\u043A\u043D\u043E\u043C \u0441\u043B\u044B\u0448\u0443 \u0438\u0445 \u0433\u043E\u043B\u043E\u0441\u0430. \u0414\u0432\u0430 \u043F\u0430\u0440\u043D\u044F \u043B\u0435\u0442 23, \u0432\u043E\u043E\u0431\u0449\u0435 \u043E\u0434\u0438\u043D\u0430\u043A\u043E\u0432\u044B\u0435. \u041A\u0430\u043A \u044F \u0438\u0445 \u0440\u0430\u0437\u043B\u0438\u0447\u0430\u044E \u0434\u043B\u044F \u0441\u0435\u0431\u044F, \u0441\u0442\u0430\u043D\u0435\u0442 \u044F\u0441\u043D\u043E \u0434\u0430\u043B\u044C\u0448\u0435. \u041A\u0430\u0436\u0434\u044B\u0439 \u0442\u0435\u043F\u043B\u044B\u0439 \u0434\u0435\u043D\u044C, \u043A\u043E\u0433\u0434\u0430 \u044F \u0432\u043E\u0437\u0432\u0440\u0430\u0449\u0430\u044E\u0441\u044C \u0434\u043E\u043C\u043E\u0439 \u0441 \u0440\u0430\u0431\u043E\u0442\u044B, \u044F \u0437\u0430\u0441\u0442\u0430\u044E \u043A\u0443\u0447\u043A\u0443 \u0434\u0435\u0442\u0435\u0439, \u0431\u0435\u0433\u0430\u044E\u0449\u0438\u0445 \u0432\u043E\u043A\u0440\u0443\u0433 \u0441\u043A\u0443\u0442\u0435\u0440\u0430 \u0438 \u0438\u0433\u0440\u0430\u044E\u0449\u0438\u0445 \u0432 \u043D\u0435\u043F\u043E\u043D\u044F\u0442\u043D\u0443\u044E \u043C\u043D\u0435 \u0438\u0433\u0440\u0443, \u043A\u043E\u043C\u0431\u0438\u043D\u0430\u0446\u0438\u044E \u0441\u0430\u043B\u043E\u043A, \u043F\u0440\u044F\u0442\u043E\u043A \u0438 \u043A\u0430\u0437\u0430\u043A\u043E\u0432-\u0440\u0430\u0437\u0431\u043E\u0439\u043D\u0438\u043A\u043E\u0432. \u0427\u0430\u0441\u0442\u0435\u043D\u044C\u043A\u043E \u043E\u043D\u0438 \u0438\u0433\u0440\u0430\u044E\u0442 \u0432 \u043C\u044F\u0447, \u043A\u043E\u043B\u043E\u0442\u044F \u0435\u0433\u043E \u043E\u0431 \u0441\u0442\u0435\u043D\u0443 \u0434\u043E\u043C\u0430 \u0438 \u0440\u0435\u0448\u0435\u0442\u043A\u0438 \u043C\u043E\u0438\u0445 \u043E\u043A\u043E\u043D, \u043D\u043E \u043A\u0430\u043A \u044F \u0437\u0430\u0445\u043E\u0436\u0443 \u0434\u043E\u043C\u043E\u0439 \u0438 \u0432\u043A\u043B\u044E\u0447\u0430\u044E \u0441\u0432\u0435\u0442, \u043E\u043D\u0438 \u0442\u0443\u0442 \u0436\u0435 \u0440\u0430\u0437\u0431\u0435\u0433\u0430\u044E\u0442\u0441\u044F \u043A\u0442\u043E \u043D\u0430 \u043A\u0430\u0447\u0435\u043B\u0438, \u043A\u0442\u043E \u043D\u0430 \u0433\u043E\u0440\u043A\u0443. \u0418\u043D\u0442\u0435\u043B\u043B\u0438\u0433\u0435\u043D\u0446\u0438\u044F =) \u041F\u043E \u043D\u043E\u0447\u0430\u043C \u043C\u043E\u0439 \u0434\u0432\u043E\u0440 \u043D\u0435 \u0441\u043F\u0438\u0442! \u0427\u0430\u0441\u0442\u0435\u043D\u044C\u043A\u043E \u043F\u043E \u0443\u0442\u0440\u0430\u043C \u043C\u043D\u0435 \u043F\u0440\u0438\u0445\u043E\u0434\u0438\u0442\u0441\u044F \u0432\u044B\u043F\u0440\u044F\u043C\u043B\u044F\u0442\u044C \u0441\u043E\u0433\u043D\u0443\u0442\u044B\u0435 \u0437\u0435\u0440\u043A\u0430\u043B\u0430 \u043D\u0430 \u0441\u043A\u0443\u0442\u0435\u0440\u0435 \u0438 \u0443\u0431\u0438\u0440\u0430\u0442\u044C \u0433\u043E\u0440\u0443 \u0431\u0443\u0442\u044B\u043B\u043E\u043A \u043E\u0442 \u043D\u0435\u0433\u043E. \u0413\u043E\u043B\u043E\u0441\u0430, \u0441\u043C\u0435\u0445 \u0438 \u043F\u0435\u043D\u0438\u0435 \u043F\u0440\u043E\u0434\u043E\u043B\u0436\u0430\u044E\u0442\u0441\u044F \u0434\u043E \u0433\u043B\u0443\u0431\u043E\u043A\u043E\u0439 \u043D\u043E\u0447\u0438. \u0411\u044B\u0432\u0430\u044E\u0442 \u0438 \u0443\u043D\u0438\u043A\u0430\u043B\u044C\u043D\u044B\u0435 \u0441\u043B\u0443\u0447\u0430\u0438. \u0412\u043E\u0442 \u043E\u0434\u043D\u0430\u0436\u0434\u044B \u044F \u043F\u0440\u043E\u0441\u043D\u0443\u043B\u0441\u044F \u043E\u0442 \u0441\u0442\u043E\u043D\u0430, \u043A\u0430\u043A \u0431\u0443\u0434\u0442\u043E \u0431\u044B, \u0443\u043C\u0438\u0440\u0430\u044E\u0449\u0435\u0433\u043E \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430. \u0412\u044B\u0433\u043B\u044F\u043D\u0443\u043B \u0432 \u043E\u043A\u043D\u043E - \u043D\u0443 \u0434\u0430. \u041E\u0434\u0438\u043D \u0438\u0437 \u0431\u043B\u0438\u0437\u043D\u0435\u0446\u043E\u0432 \u043F\u043E\u043B\u0437\u0435\u0442 \u043F\u043E \u0437\u0435\u043C\u043B\u0435, \u043F\u0430\u0447\u043A\u0430\u044F \u0435\u0435 \u043A\u0440\u043E\u0432\u044C\u044E, \u0430 \u0435\u0433\u043E \u0441\u0442\u0430\u0440\u0448\u0438\u0439 \u043D\u0430 \u0434\u0432\u0430 \u0447\u0430\u0441\u0430 \u0431\u0440\u0430\u0442 \u043F\u0440\u044B\u0433\u0430\u0435\u0442 \u0443 \u043D\u0435\u0433\u043E \u043D\u0430 \u0441\u043F\u0438\u043D\u0435. \u0412\u044B\u043D\u0435\u0441 \u0432\u043E\u0434\u044B \u0432 \u0433\u0440\u0430\u0444\u0438\u043D\u0435 \u0438 \u043F\u043E\u043D\u044F\u043B, \u0447\u0442\u043E \u043D\u0443 \u043D\u0435 \u043F\u043E\u0434\u0435\u043B\u0438\u043B\u0438 \u043E\u043D\u0438 \u0447\u0435\u0433\u043E-\u0442\u043E. \u0422\u0435\u043F\u0435\u0440\u044C \u043C\u043B\u0430\u0434\u0448\u0435\u0433\u043E \u044F \u043F\u043E \u0448\u0440\u0430\u043C\u0443 \u043D\u0430 \u0433\u043E\u043B\u043E\u0432\u0435 \u043E\u0442\u043B\u0438\u0447\u0430\u044E =) \u041A\u0430\u043A-\u0442\u043E \u044F \u043F\u0440\u043E\u0441\u043D\u0443\u043B\u0441\u044F \u043E\u0442 \u0442\u043E\u0433\u043E, \u0447\u0442\u043E \u0443\u0432\u0438\u0434\u0435\u043B \u043D\u0430 \u043E\u043A\u043D\u0435 \u0441\u0438\u043B\u0443\u044D\u0442 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430, \u0432\u0438\u0441\u044F\u0449\u0435\u0433\u043E \u043D\u0430 \u0440\u0435\u0448\u0435\u0442\u043A\u0435 \u043C\u043E\u0435\u0433\u043E \u043E\u043A\u043D\u0430. \u0412\u044B\u043B\u0435\u0437\u0430\u0442\u044C \u044F \u043D\u0435 \u0441\u0442\u0430\u043B, \u0430 \u043B\u0438\u0448\u044C \u0441\u043B\u0443\u0448\u0430\u043B \u0436\u0435\u043D\u0441\u043A\u0438\u0439 \u0433\u043E\u043B\u043E\u0441, \u043F\u0440\u0438\u0433\u043E\u0432\u0430\u0440\u0438\u0432\u0430\u044E\u0449\u0438\u0439 "\u0421\u0435\u0440\u0451\u0436\u0430, \u043D\u0435 \u043D\u0430\u0430\u0434\u043E". \u0427\u0435\u0440\u0435\u0437 5 \u043C\u0438\u043D\u0443\u0442 \u044F \u0443\u0436\u0435 \u0443\u0441\u043B\u044B\u0448\u0430\u043B \u0441\u043E\u0442\u0440\u044F\u0441\u0430\u044E\u0449\u0438\u0435 \u0441\u0442\u0435\u043D\u044B \u0443\u0434\u0430\u0440\u044B \u0443 \u0441\u0435\u0431\u044F \u043F\u0435\u0440\u0435\u0434 \u0432\u0445\u043E\u0434\u043D\u043E\u0439 \u0434\u0432\u0435\u0440\u044C\u044E. \u0414\u0443\u043C\u0430\u043B \u043A\u043E \u043C\u043D\u0435 \u043B\u043E\u043C\u044F\u0442\u0441\u044F \u043D\u043E\u0433\u0430\u043C\u0438. \u0412\u0437\u044F\u043B \u0432 \u0440\u0443\u043A\u0443 \u0442\u043E\u043F\u043E\u0440 \u0438 \u043F\u043E\u0434\u043E\u0448\u0435\u043B \u043A \u0433\u043B\u0430\u0437\u043A\u0443. \u041A\u0430\u043A\u043E\u0439-\u0442\u043E \u043A\u0440\u0443\u043F\u043D\u044B\u0439 \u0434\u044F\u0434\u044C\u043A\u0430 \u043D\u0430\u0441\u0442\u043E\u0439\u0447\u0438\u0432\u043E \u043F\u044B\u0442\u0430\u043B\u0441\u044F \u0432\u044B\u0431\u0438\u0442\u044C \u0441\u043E\u0441\u0435\u0434\u0441\u043A\u0443\u044E \u0434\u0432\u0435\u0440\u044C \u043D\u043E\u0433\u043E\u0439. \u042F \u0430\u043A\u043A\u0443\u0440\u0430\u0442\u043D\u043E \u043F\u0440\u0438\u043E\u0442\u043A\u0440\u044B\u043B \u0434\u0432\u0435\u0440\u044C, \u0432\u044B\u0433\u043B\u044F\u043D\u0443\u043B \u0438 \u0432\u0435\u0436\u043B\u0438\u0432\u043E \u0441\u043F\u0440\u043E\u0441\u0438\u043B, \u043A \u0447\u0435\u043C\u0443 \u0442\u0430\u043A\u0430\u044F \u0441\u0443\u0435\u0442\u0430. \u041E\u043A\u0430\u0437\u0430\u043B\u043E\u0441\u044C, \u0441\u043E\u0441\u0435\u0434\u0438 \u0432\u0435\u0440\u043D\u0443\u043B\u0438\u0441\u044C \u0438\u0437 \u043E\u0442\u043F\u0443\u0441\u043A\u0430, \u0430 \u0441\u0435\u0441\u0442\u0440\u0430 \u0445\u043E\u0437\u044F\u0439\u043A\u0438 \u0437\u0430\u043F\u0435\u0440\u043B\u0430 \u0432\u0442\u043E\u0440\u0443\u044E \u0434\u0432\u0435\u0440\u044C \u0438 \u0443\u0435\u0445\u0430\u043B\u0430 \u0432 \u0441\u0432\u043E\u0439 \u043E\u0442\u043F\u0443\u0441\u043A, \u0437\u0430\u0431\u0440\u0430\u0432 \u0435\u0434\u0438\u043D\u0441\u0442\u0432\u0435\u043D\u043D\u044B\u0439 \u043A\u043B\u044E\u0447. \u041E\u043D\u0438 \u043F\u043E\u043F\u0440\u043E\u0441\u0438\u043B\u0438 \u0443 \u043C\u0435\u043D\u044F \u0442\u043E\u043F\u043E\u0440 \u0438, \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u044C\u0442\u0435 \u044D\u0442\u0443 \u043D\u0435\u043C\u0443\u044E \u0441\u0446\u0435\u043D\u0443, \u043A\u043E\u0433\u0434\u0430 \u044F \u0442\u043E\u0442\u0447\u0430\u0441\u0436\u0435 \u043F\u0440\u043E\u0442\u044F\u043D\u0443\u043B \u0438\u043C \u043E\u0433\u0440\u043E\u043C\u043D\u044B\u0439 \u0440\u0436\u0430\u0432\u044B\u0439 \u0442\u043E\u043F\u043E\u0440 \u0441 \u0430\u043D\u0442\u0440\u0435\u0441\u043E\u043B\u0435\u0439! \u041E\u043D\u0438 \u0437\u0430\u043C\u044F\u043B\u0438\u0441\u044C, \u0440\u0430\u0437\u0434\u0443\u043C\u0430\u043B\u0438, \u0434\u0435\u0434\u0443\u043B\u044F-\u0441\u043E\u0441\u0435\u0434 \u043F\u043E\u044F\u0441\u043D\u0438\u043B, \u0447\u0442\u043E \u0442\u043E\u043F\u043E\u0440 \u0443 \u043C\u0435\u043D\u044F \u0445\u043E\u0440\u043E\u043E\u043E\u043E\u0448\u0438\u0439, \u043D\u0435 \u043C\u0430\u0441\u0442\u0435\u0440\u043E\u0432\u043E\u0439 \u043F\u0440\u0430\u0432\u0434\u0430, \u043D\u043E \u0445\u043E\u0440\u043E\u043E\u043E\u0448\u0438\u0439, \u043D\u043E \u0434\u0432\u0435\u0440\u044C \u0440\u0443\u0431\u0438\u0442\u044C \u043F\u0435\u0440\u0435\u0434\u0443\u043C\u0430\u043B\u0438. \u0422\u0430\u043A \u0438 \u043E\u0442\u0447\u0430\u043B\u0438\u043B\u0438 \u043D\u043E\u0447\u044C\u044E \u043A \u0434\u0440\u0443\u0437\u044C\u044F\u043C \u043D\u043E\u0447\u0435\u0432\u0430\u0442\u044C \u0438 \u043E\u0431\u0434\u0443\u043C\u044B\u0432\u0430\u0442\u044C \u041F\u043B\u0430\u043D \u0432\u0437\u043B\u043E\u043C\u0430 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u044B. \u0411\u044B\u0432\u0430\u044E\u0442 \u0438 \u043F\u0440\u0438\u044F\u0442\u043D\u044B\u0435 \u0441\u044E\u0440\u043F\u0440\u0438\u0437\u044B. \u041D\u043E \u043E\u0447\u0435\u043D\u044C \u0437\u0430\u0433\u0430\u0434\u043E\u0447\u043D\u044B\u0435! \u0411\u0443\u043A\u0432\u0430\u043B\u044C\u043D\u043E \u0434\u0432\u0430 \u0434\u043D\u044F \u043D\u0430\u0437\u0430\u0434, \u0432\u0435\u0440\u043D\u0443\u0432\u0448\u0438\u0441\u044C \u0434\u043E\u043C\u043E\u0439 \u0438 \u0441\u0445\u043E\u0434\u044F \u0437\u0430 \u0445\u043B\u0435\u0431\u043E\u043C, \u044F \u0432\u043E\u0437\u0432\u0440\u0430\u0449\u0430\u043B\u0441\u044F \u0434\u043E\u043C\u043E\u0439. \u0418 \u0437\u0430\u043F\u0440\u0438\u043C\u0435\u0442\u0438\u043B, \u0447\u0442\u043E \u043D\u0430 \u0447\u0435\u0445\u043B\u0435 \u043C\u043E\u0435\u0433\u043E \u0441\u043A\u0443\u0442\u0435\u0440\u0430 \u043F\u043E\u043C\u0438\u043C\u043E \u0438\u0437\u0432\u0435\u0447\u043D\u044B\u0445 \u0431\u044B\u0447\u043A\u043E\u0432 \u0441 \u0431\u0430\u043B\u043A\u043E\u043D\u043E\u0432 \u0438 \u043F\u0442\u0438\u0447\u044C\u0438\u0445 \u043A\u0430\u043A\u0430\u0448\u0435\u043A \u0441 \u0434\u0435\u0440\u0435\u0432\u0430 \u0441\u0442\u043E\u0438\u0442 \u0422\u041E\u0420\u0422 "\u0421\u041A\u0410\u0417\u041A\u0410"! \u0421\u0442\u043E\u0438\u0442 \u0441\u0435\u0431\u0435 \u0438 \u043D\u0438\u043A\u0443\u0434\u0430 \u043D\u0435 \u0441\u043E\u0431\u0438\u0440\u0430\u0435\u0442\u0441\u044F! \u042F \u043F\u043E\u0434\u043E\u0448\u0435\u043B, \u0441\u0434\u0435\u043B\u0430\u043B \u0433\u043B\u0443\u043F\u043E\u0435 \u043B\u0438\u0446\u043E, \u043E\u0437\u0438\u0440\u0430\u043B\u0441\u044F \u043C\u0438\u043D\u0443\u0442 5 \u0432 \u043E\u0436\u0438\u0434\u0430\u043D\u0438\u0438 \u043A\u0440\u0438\u043A\u0430 "\u0441\u044E\u0440\u043F\u0440\u0438\u0438\u0438\u0437", \u043D\u043E \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442\u0430 \u044D\u0442\u043E \u043D\u0435 \u0434\u0430\u043B\u043E. \u0422\u043E\u043B\u044C\u043A\u043E \u0432\u0435\u0441\u044C \u0434\u0432\u043E\u0440 \u0441\u0442\u0430\u043B \u043D\u0430 \u043C\u0435\u043D\u044F \u043A\u043E\u0441\u0438\u0442\u044C\u0441\u044F, \u0447\u0442\u043E \u044D\u0442\u043E \u044F \u0442\u0430\u043C \u0441\u0442\u043E\u044E \u0438 \u0442\u0443\u043F\u043E \u043B\u044B\u0431\u043B\u044E\u0441\u044C \u043F\u043E\u0434 \u0434\u0435\u0440\u0435\u0432\u043E\u043C. \u041F\u043E\u0441\u0442\u043E\u044F\u043B \u0435\u0449\u0435 5 \u043C\u0438\u043D\u0443\u0442 \u0443\u0436\u0435 \u0441\u0435\u0440\u044C\u0435\u0437\u043D\u043E \u043E\u0433\u043B\u044F\u0434\u044B\u0432\u0430\u044F \u043E\u043A\u0440\u0435\u0441\u0442\u043D\u043E\u0441\u0442\u0438, \u043D\u043E \u043E\u043F\u044F\u0442\u044C \u0436\u0435, \u0445\u043E\u0437\u044F\u0438\u043D\u0430 \u0442\u043E\u0440\u0442\u0430 \u044F \u043D\u0435 \u043D\u0430\u0448\u0435\u043B. \u041F\u0440\u0438\u0448\u043B\u043E\u0441\u044C \u0432\u0437\u044F\u0442\u044C \u0441\u043A\u0430\u0437\u043A\u0443 \u0441 \u0441\u043E\u0431\u043E\u0439. \u0422\u043E\u0440\u0442\u0438\u043A \u043E\u043A\u0430\u0437\u0430\u043B\u0441\u044F \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E \u043D\u0435\u0442\u0440\u043E\u043D\u0443\u0442\u044B\u043C, \u043D\u043E, \u043A \u0441\u043E\u0436\u0430\u043B\u0435\u043D\u0438\u044E, \u043F\u0440\u043E\u0441\u0440\u043E\u0447\u0435\u043D\u043D\u044B\u043C \u043D\u0430 \u043D\u0435\u0434\u0435\u043B\u044E. \u0418\u0441\u0442\u043E\u0440\u0438\u044F \u0435\u0433\u043E \u0432\u043E\u0437\u043D\u0438\u043A\u043D\u043E\u0432\u0435\u043D\u0438\u044F \u0434\u043B\u044F \u043C\u0435\u043D\u044F \u0434\u043E \u0441\u0438\u0445 \u043F\u043E\u0440 \u0437\u0430\u0433\u0430\u0434\u043A\u0430. \u0425\u043E\u0442\u044F \u0432\u0435\u0440\u0441\u0438\u0439 \u0435\u0441\u0442\u044C \u043A\u0443\u0447\u0430 \u043E\u0442 \u0441\u043E\u0432\u0441\u0435\u043C \u043F\u0440\u043E\u0441\u0442\u044B\u0445 "\u0442\u0430\u043A \u0432\u044B\u043A\u0438\u043D\u0443\u043B\u0438" \u0434\u043E \u0441\u043E\u0432\u0435\u0440\u0448\u0435\u043D\u043D\u043E \u043A\u043E\u0441\u043C\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u0445. \u041D\u0435 \u0432\u044B\u0431\u0440\u0430\u0441\u044B\u0432\u0430\u044E \u0435\u0433\u043E \u0442\u043E\u043B\u044C\u043A\u043E \u0434\u043B\u044F \u0442\u043E\u0433\u043E, \u0447\u0442\u043E\u0431\u044B \u0431\u044B\u043B\u043E \u043F\u043E\u0434\u0442\u0432\u0435\u0440\u0436\u0434\u0435\u043D\u0438\u0435 \u0440\u0435\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u0438 \u044D\u0442\u043E\u0433\u043E \u0441\u043B\u0443\u0447\u0430\u044F \u043F\u043E-\u043A\u0440\u0430\u0439\u043D\u0435\u0439 \u043C\u0435\u0440\u0435 \u0434\u043B\u044F \u0441\u0435\u0431\u044F. \u0412\u043E\u0442 \u0441\u0435\u0439\u0447\u0430\u0441 \u0448\u0435\u043B \u0438\u0437 \u043C\u0430\u0433\u0430\u0437\u0438\u043D\u0430 \u043E\u043F\u044F\u0442\u044C, \u043A\u0443\u043F\u0438\u043B \u043A\u0430\u0440\u0442\u043E\u0448\u043A\u0438 \u0438 \u043B\u0438\u043C\u043E\u043D, \u0438 \u0432 \u0441\u0432\u043E\u0435\u043C \u0434\u0432\u043E\u0440\u0435 \u043E\u0431\u043D\u0430\u0440\u0443\u0436\u0438\u043B \u0421\u0430\u043D\u044E \u0416\u0434\u0430\u043D\u043E\u0432\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439, \u0432\u0438\u0434\u0438\u0442\u0435 \u043B\u0438, \u043F\u0440\u043E\u0433\u0443\u043B\u0438\u0432\u0430\u043B\u0441\u044F \u0442\u0443\u0442 \u043F\u0435\u0440\u0435\u0434 \u043F\u0440\u043E\u0441\u043C\u043E\u0442\u0440\u043E\u043C \u043A\u0430\u043A\u043E\u0433\u043E-\u0442\u043E \u043C\u0430\u0442\u0447\u0430 \u0441 \u0440\u0435\u0431\u044F\u0442\u0430\u043C\u0438 \u0432 \u0441\u043F\u043E\u0440\u0442\u0431\u0430\u0440\u0435 \u0447\u0435\u0440\u0435\u0437 \u0434\u043E\u0440\u043E\u0433\u0443. \u0415\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043D\u043D\u043E, \u0421\u0430\u0448\u0430 \u0431\u044B\u043B \u0443\u0433\u043E\u0449\u0435\u043D \u0446\u0435\u043B\u0435\u0431\u043D\u044B\u043C \u0440\u043E\u0439\u0431\u0443\u0448\u0435\u043C \u0441 \u043C\u0435\u0434\u043E\u043C \u0438 \u043B\u0438\u043C\u043E\u043D\u0447\u0438\u043A\u043E\u043C.',-1),c=t("p",null,"\u0416\u0438\u0432\u043E\u0439 \u0414\u0432\u043E\u0440. \u041D\u0435 \u0431\u0435\u0437\u043B\u0438\u043A\u0430\u044F \u0443\u043B\u0438\u0446\u0430, \u0430 \u0446\u0435\u043B\u044B\u0439 \u043C\u0430\u043B\u0435\u043D\u044C\u043A\u0438\u0439 \u043C\u0438\u0440\u043E\u043A. \u0418 \u043F\u0443\u0441\u043A\u0430\u0439 \u0436\u0438\u0432\u0443 \u044F \u0442\u0443\u0442 \u0432\u0441\u0435\u0433\u043E \u043B\u0438\u0448\u044C \u043F\u043E\u043B\u0433\u043E\u0434\u0430, \u043D\u043E \u044D\u0442\u043E \u0443\u0436\u0435, \u043A\u0430\u043A \u0431\u0443\u0434\u0442\u043E \u0431\u044B, \u0440\u043E\u0434\u043D\u043E\u0435 \u0442\u0430\u043A\u043E\u0435 \u043C\u0435\u0441\u0442\u0435\u0447\u043A\u043E. \u0417\u0430\u0433\u043B\u044F\u0434\u044B\u0432\u0430\u0439\u0442\u0435! \u041D\u043E \u043D\u043E\u0447\u044C\u044E - \u043F\u043E\u0430\u043A\u043A\u0443\u0440\u0430\u0442\u043D\u0435\u0435!",-1),i=t("p",null,[t("a",{href:"https://vk.com/note129086_9513772",class:"external-link",target:"_blank",rel:"noreferrer"},"2009-09-09")],-1),_=[s,o,c,i];function l(d,p,h,f,m,u){return a(),r("div",null,_)}const k=e(n,[["render",l]]);export{v as __pageData,k as default};
